From the BluRay review:

The Castle is presented in the film's original aspect ratio of 1.78:1,
encoded with AVC MPEG-4 compression.
For years, the only available Australian release of The Castle was derived
from an ancient VHS master which cropped the original aspect ratio to 4x3
which featured slightly more vertical information, at the expense of the
horizontal, deviating significantly from the intended aspect ratio.
In 2008 Roadshow released a remastered DVD version from a new master which
rectified this. This Blu-ray release comes from that same transfer,
with naturally better results.
